original_question:
താഴെ കാണിച്ചിരിക്കുന്ന ചിത്രത്തിൽ $\sin D = 0.7$ ആണെന്ന് കരുതുക. $DE$ എത്രയാണ്? [asy]
pair D,E,F;
F = (0,0);
D = (sqrt(51),7);
E = (0,7);
draw(D--E--F--D);
draw(rightanglemark(D,E,F,15));
label("$D$",D,NE);
label("$E$",E,NW);
label("$F$",F,SW);
label("$7$",(E+F)/2,W);
[/asy]

